import React from 'react'
import { Box, TextField, Button, Typography } from '@mui/material'

export default function MensajeForm() {
  return (
    <Box sx={{width:'100%', display:'flex',flexDirection:'column'}}>
        <Typography sx={{padding:2}}> Mensaje personalizado</Typography>
        <TextField
        multiline
        rows = {3}
        label='mensaje'
        >
        </TextField>
        <Button variant="contained" color="primary" sx={{ marginTop: 2 }} type="submit">Agregar</Button>
    </Box>
  )
}
